import React from 'react'

const Header = (props) => {
  return(
  <>
  <h1>{props.course}</h1>
  </>
  )
}

const Part = (props) => {
  return(
    <>
    <p>{props.name} {props.exercises}</p>
    </>
  )
}

const Content = (Content1, Content2, Content3, exercises1, exercises2, exercises3) => {
  return (
    <div>
      <Part name = {Content1} exercises={exercises1}/>
      <Part name = {Content2} exercises={exercises2}/>
      <Part name = {Content3} exercises={exercises3}/>
    </div>
  )
}

const Total = (props) => {
  return(
  <>
  <p>Number of exercises {props.number}</p>
  </>
  )
}

const App = () => {
  const course = 'Half Stack application development'
  const Content1 = 'Fundamentals of React'
  const exercises1 = 10
  const Content2 = 'Using props to pass data'
  const exercises2 = 7
  const Content3 = 'State of a component'
  const exercises3 = 14

  return (
    <>
      <Header course={course}/>
      <Content />
      <Total number = {exercises1 + exercises2 + exercises3}/>
    </>
  )
}

export default App
